CREATE TABLE `api_register` (
  `apply_id` varchar(32) COLLATE utf8mb4_general_ci NOT NULL,
  `apply_status` tinyint DEFAULT NULL,
  `apply_time` datetime NOT NULL,
  `reply_time` datetime DEFAULT NULL,
  `reply_reason` varchar(1024) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `id` varchar(32) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `user_id` varchar(32) COLLATE utf8mb4_general_ci NOT NULL,
  `name` varchar(32) COLLATE utf8mb4_general_ci NOT NULL,
  `price` double NOT NULL,
  `protocol` tinyint NOT NULL,
  `url` varchar(2083) COLLATE utf8mb4_general_ci NOT NULL,
  `method` tinyint NOT NULL,
  `introduction` varchar(1024) COLLATE utf8mb4_general_ci NOT NULL,
  `visible` tinyint NOT NULL,
  `param` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `query` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `request_header` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `request_body` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `response_header` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `response_body` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin,
  `is_delete` tinyint DEFAULT NULL,
  PRIMARY KEY (`apply_id`),
  KEY `id` (`id`),
  KEY `user_id` (`user_id`),
  CONSTRAINT `api_register_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`),
  CONSTRAINT `api_register_ibfk_2` FOREIGN KEY (`id`) REFERENCES `api` (`id`),
  CONSTRAINT `api_register_chk_1` CHECK (json_valid(`param`)),
  CONSTRAINT `api_register_chk_2` CHECK (json_valid(`query`)),
  CONSTRAINT `api_register_chk_3` CHECK (json_valid(`request_header`)),
  CONSTRAINT `api_register_chk_4` CHECK (json_valid(`request_body`)),
  CONSTRAINT `api_register_chk_5` CHECK (json_valid(`response_header`)),
  CONSTRAINT `api_register_chk_6` CHECK (json_valid(`response_body`))
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;
