INSERT INTO `organization` VALUES ('3496215870f64700b7ab5d813adb2a53','1',1,'18056664507','461556974@qq.com','11,1101,110101','1','1','e675a62fa8f24e9ebc0cff4e1a1634c5','2024-05-06 00:00:00','2024-05-06 22:07:31','2024-05-06 22:07:31',NULL,'organization/3496215870f64700b7ab5d813adb2a53/687b0f3a31097ee3f70bd5935a68c37a.jpg','organization/3496215870f64700b7ab5d813adb2a53/eb429ce554ac4ede2bc6e76e10e0c92b.zip',0),('531272ad1f1f48629e080d6ee7146a92','0508',1,'18056664507','461556974@qq.com','11,1101,110101','1','1','e675a62fa8f24e9ebc0cff4e1a1634c5','2024-05-08 00:00:00','2024-05-08 14:48:43','2024-05-08 14:48:43',NULL,'organization/531272ad1f1f48629e080d6ee7146a92/687b0f3a31097ee3f70bd5935a68c37a.jpg','organization/531272ad1f1f48629e080d6ee7146a92/eb429ce554ac4ede2bc6e76e10e0c92b.zip',0),('6b4da388e02e499ba76a98a3b5796194','0506',1,'18056664507','461556974@qq.com','11,1101,110101','1','1','e675a62fa8f24e9ebc0cff4e1a1634c5','2024-05-06 00:00:00','2024-05-06 21:46:53','2024-05-06 21:46:53',NULL,'organization/6b4da388e02e499ba76a98a3b5796194/687b0f3a31097ee3f70bd5935a68c37a.jpg','organization/6b4da388e02e499ba76a98a3b5796194/eb429ce554ac4ede2bc6e76e10e0c92b.zip',0),('a0c7b2b7e3564e70b6f4f80ef42b9b24','北京航空航天大学计算机学院',3,'010-82313267','scse@buaa.edu.cn','11,1101,110108','北京市海淀区学院路37号','北京航空航天大学1958年建立计算机专业，1978年成立计算机科学与工程系，2002年组建计算机学院，至今已走过了六十年的发展历程。计算机专业的发展是随着国家需求和大时代政策背景而发展的，是各级领导关心和大力支持的结果，更凝结了北航几代计算机人团结奋斗所付出的心血和汗水。经历了充满激情、艰苦奋斗的创业建设阶段，勇于开拓、协调发展的持续提高阶段，敢为人先、不断进取的全面发展阶段和凝心聚力、勇攀高峰的全面提高阶段，取得了一个又一个辉煌的业绩，为国家培养了一批又一批计算机专业人才，始终走在我国计算机高等教育与科学研究的前列，1998年计算机科学与技术成为国家一级学科，在2006年教育部组织的计算机一级学科评估中排名第三，2007年获首批计算机一级国家重点学科（7家单位之一），2011年软件工程成为国家一级学科，2012年全国一级学科评估中，计算机科学与技术、软件工程两个一级学科全国高校排名均第4；2017年全国一级学科评估中，计算机科学与技术评估结果为A、软件工程评估结果为A+。2017年计算机科学与技术、软件工程获批国家“双一流”建设学科。\n计算机学院现有教职工163人，其中中国科学院院士2人，中国工程院院士1人，英国皇家学会院士1人，教授52人，副教授56人，具有1年以上海外留学经历的比例为57.9%。形成了一支以两院院士与国际著名专家为学科带头人、以年富力强的中青年知名学者为骨干、学术造诣深、团结协作并且年龄结构合理的师资队伍。\n目前学院建有2个国家重点实验室，１个国家工程实验室，1个国家工程技术中心，１个国家级国际科技合作基地、6个省部级重点实验室、1个高精尖创新中心等高水平研究基地，逐步形成了计算机科学与智能技术、数据科学与软件工程两大优势学科群，以及虚拟现实与增强现实、未来网络与信息安全、可视计算与人机智能、新型体系结构与计算系统、大数据科学与认知计算、安全可靠系统工程、群体软件与智能系统、超大规模系统与软件理论等一批优势特色及前沿交叉研究方向。','e675a62fa8f24e9ebc0cff4e1a1634c5','1978-07-01 00:00:00','2024-03-14 18:08:59','2024-03-14 17:50:14',NULL,'organization/56745b7fd0cc4e32840a96cade011a03.jpeg','organization/5bb2c530b91a456ea88083b769a2514c.zip',0),('d5e289dfc5ff4f97ae5fda10f27936d5','清华大学',3,'13915558435','1843781563@qq.com','11,1101,110108','中国北京市海淀区蓝旗营双清路30号','清华大学拥有百年历史，所在地清华园原为清康熙帝皇三子胤祉园林（熙春园）。1909年，清政府用美国退还的部分庚子赔款建立留美预备学校“游美学务处”及附设“肄业馆”。1911年，改肄业馆为“清华学堂”，不久易名“清华学校”。1925年始设大学部。1928年，南京国民政府接管并建立“国立清华大学”。1937年抗日战争爆发后，清华与北大、南开三校南迁组建国立长沙临时大学，1938年迁至昆明，易名国立西南联合大学。1946年，迁回清华园复校。1948年，国立清华大学校舍为中国人民解放军接收，次年改为“清华大学”；国立清华大学则于1956年在台复校。\n1952年，中华人民共和国全国高校院系调整中，清华由全科性综合大学转为多科性工业大学，被誉为“工程师的摇篮”。文革期间，红卫兵运动从清华附中萌生，清华“井冈山”兵团联合各高校掀起文革群众运动浪潮，并因内部分歧引发北京最严重武斗。改革开放后，清华大学逐步恢复理科、人文社科、经济管理类学科，先后制定实施“211工程”“九五”“985工程”和“十五”规划，确定了“建设世界一流大学”的目标。百年校庆之后，制定“双一流”建设方案。','feb15885025d4b8590928d55d9083140','1911-01-01 00:00:00','2024-03-26 01:33:35','2024-03-26 01:33:35',NULL,'organization/d5e289dfc5ff4f97ae5fda10f27936d5/c2b8cefdf66036f009cfe6d53904105f.png','organization/d5e289dfc5ff4f97ae5fda10f27936d5/7e6a91659f645109dfcd40f574bd5737.zip',0),('e2b05de6bf6b4fbea877db713d4d5e70','test0506',1,'18056664507','461556974@qq.com','11,1101,110101','addressTest','introTest','e675a62fa8f24e9ebc0cff4e1a1634c5','2024-05-06 00:00:00','2024-05-06 20:19:55','2024-05-06 21:51:42',NULL,'organization/e2b05de6bf6b4fbea877db713d4d5e70/7d35fc8c0d91f060e1ebd9d0573f0763.jpg','organization/e2b05de6bf6b4fbea877db713d4d5e70/eb429ce554ac4ede2bc6e76e10e0c92b.zip',0),('e675a62fa8f24e9ebc0cff4e1a1634c5','北京航空航天大学',3,'0106176562','support@buaa.edu.cn','11,1101,110108','学院路37号','北京航空航天大学，位于首都北京市，是中华人民共和国工业和信息化部直属的全国重点大学，中央直管高校， 位列国家“双一流”、“985工程”、“211工程”重点建设高校，入选珠峰计划、2011计划、111计划、卓越工程师教育培养计划、国家建设高水平大学公派研究生项目、中国政府奖学金来华留学生接收院校、国家级新工科研究与实践项目、国家级大学生创新创业训练计划、国家大学生创新性实验计划、全国深化创新创业教育改革示范高校、强基计划试点高校，为国际宇航联合会、中欧精英大学联盟、中国-西班牙大学联盟、中俄工科大学联盟、中国高校行星科学联盟、中国人工智能教育联席会、全国高等军工院校课程思政联盟、W3C组织成员。 学校创建于1952年，时名北京航空学院，由当时的北洋大学、清华大学、厦门大学、四川大学、重庆大学等八所院校的航空系合并组建，1959年学校被国家指定为全国重点高校，1988年4月2日改名为北京航空航天大学。2017年入选“世界一流大学和一流学科”建设高校A类名单。截至2024年1月，学校有学院路校区、沙河校区、杭州国际校园总占地约4000亩；设有35个二级学院，开设78个本科专业；拥有26个博士后科研流动站，33个博士学位授权一级学科点，36个硕士学位授权一级学科点；有教职工总数6150人，其中专任教师3097人；在校生39666人，其中本科生16346人、研究生22198人、留学生1122人。','feb15885025d4b8590928d55d9083140','1952-10-25 00:00:00','2024-03-07 20:08:58','2024-05-17 16:35:05','5df03b1cc9e443f28547e04232fcdaa3','organization/e675a62fa8f24e9ebc0cff4e1a1634c5/bcda6968d8f6600c0b8195cd59008bf5.jpg','organization/e675a62fa8f24e9ebc0cff4e1a1634c5/7e6a91659f645109dfcd40f574bd5737.zip',0),('feb15885025d4b8590928d55d9083140','数据资源可信共享平台',1,'13915558435','1843781563@qq.com','11,1101,110108','学院路37号','我们致力于建立一个安全、高效的平台，帮助用户实现数据的可信共享。我们的平台提供了一个可靠的环境，使用户能够安全地共享和访问敏感数据，同时保护数据的隐私和安全。通过我们的平台，您可以与合作伙伴、研究机构和其他利益相关者共享数据，促进创新和合作。我们采用先进的技术和严格的安全措施来保护数据的完整性和机密性，并确保数据在传输和存储过程中得到适当的加密和权限控制。我们的平台还提供灵活的数据管理工具和分析功能，帮助用户探索和利用数据的潜力。无论您是企业、研究机构还是政府部门，我们的数据资源可信共享平台将为您提供一个可靠的合作平台，帮助您实现数据驱动的决策和创新。加入我们的平台，共享可信数据，推动您的业务和项目取得更大的成功！',NULL,'2024-03-05 00:00:00','2024-03-05 17:14:15','2024-03-29 16:07:11','e185479ade4d43e9a1862b96c534302c','organization/feb15885025d4b8590928d55d9083140/d88f0abc10dd17150780fa4fd87a9dd0.png','organization/6c20c077982f4a66b5805c3da10a1639.zip',0);
